script: |
  super -f text -I q9514.spq | sort > q9514.out

inputs:
  - name: q9514.spq
    data: |
      SELECT DISTINCT tab1.col0 + - col1 * - col2 + tab1.col2 * + col1 * col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN NULL AND col0 * - col2;
  - name: tab1

outputs:
  - name: q9514.out
    data: |
